import FormUlFlex from "./FormUlFlex";
function UlFlex(props) {
    const css = {
        ul : {
            width: '70%',
            paddingLeft: '15%',
            paddingRight: '15%',
            height: '112px',
            backgroundColor: '#070e17',
            listStyleType: 'none',
            display: 'flex',
            justifyContent: 'space-around',
            alignItems: 'center',
            margin: '0'
        },
        img : {
            width: '215px',

        }



    }


    if (props.count === 4) {
        return (
            <div>
                <ul style={css.ul}>
                    <li><img src={props.img[0]} alt="" style={css.img} /></li>
                    <li><img src={props.img[1]} alt="" style={css.img} /></li>
                    <li><img src={props.img[2]} alt="" style={css.img} /></li>
                    <li><img src={props.img[3]} alt="" style={css.img} /></li>
                </ul>
            </div>
        )
    } else if (props.count === 5) {
        return (
            <div>
                <ul style={css.ul}>
                    <li><FormUlFlex img={props.img1} /></li>
                    <li><FormUlFlex img={props.img2} /></li>
                    <li><FormUlFlex img={props.img3} /></li>
                    <li><FormUlFlex img={props.img4} /></li>
                    <li><FormUlFlex img={props.img5} /></li>
                </ul>


            </div>
        )
    } else if (props.count === 6) {
        return (
            <div>
                <ul>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                </ul>


            </div>
        )
    } else {
        console.log('ERROR IN UlFlex.js')
    }


}
export default UlFlex;
